response:
Командир авиационного полка обнаружил недостатки в обеспечении полетов со стороны отдела технического обслуживания (OTO) и присвоил ему следующие оценки:

* Подготовке самолётов к выполнению полётов - 3 балла из 5 возможных;
* Обеспечению запасов авиатоплива - 2 балла из 5 возможных;
* Работе радиоэлектронного оборудования - 4 балла из 5 возможных.
